                         r=x0n+al1*(k*k+
     *                        stage_intern*stage_intern*(i-1))*pas
                         lpre=lcurrent
                         lcurrent=lpost
                      end do
                      lpre=lcurrent
                   end do
                   !!! new, if stage is odd
                   if (mod(stage,stage_intern)==1) then
                      call f(neqn, r, lpre,  lg_calc)
                      myfeval = myfeval + 1
                      lcurrent=lpre+pas*al1*lg_calc
                      lsumm=lsumm+b(start+stage+1)*lcurrent
                   end if
                   
                   y(:,i1)=lsumm
                   ly0n=lsumm
                   lsumm=0.0d0
                   
                   x0n=x0n+pas
                end do
             end do
             deallocate(lsumm)
             deallocate(lpre)
             deallocate(lpost)
             deallocate(lcurrent)
             deallocate(lg_calc)
             deallocate(lg_save)
             deallocate(ly0n)
!$OMP SECTION
             allocate(lsumm(neqn))
             allocate(lpre(neqn))
             allocate(lpost(neqn))
             allocate(lcurrent(neqn))
             allocate(lg_calc(neqn))
             allocate(lg_save(neqn))
             allocate(ly0n(neqn))
             lsumm=0.0d0
