                pas=dt/i1
                x0n=t
                ly0n=g
                
                if(t>0) then
                   call f(neqn, t, g,  lg_calc)
                   myfeval = myfeval + 1
                   lg_save=lg_calc
                end if
                
                do j=1,i1
                   r=x0n
                   lpre=ly0n;
                   lsumm=lsumm+b(start+1)*lpre
                   
