                      else
                         call f(neqn, r, lpre,  lg_calc)
                         myfeval = myfeval + 1
                      end if
                      lcurrent=lpre+pas*al1*lg_calc
                      lsumm=lsumm+b(start+2+(i-1)*stage_intern)*lcurrent
                      r=x0n+(1+stage_intern*stage_intern*(i-1))*pas*al1
                      do k=2,stage_intern
                         call f(neqn, r, lcurrent,  lg_calc)
                         myfeval = myfeval + 1
                         lpost=2.0d0*lcurrent-lpre+2.0d0*pas*al1*lg_calc
                         lsumm=lsumm+b(start+1+k+(i-1)*stage_intern)*
     *                        lpost
                         r=x0n+al1*(k*k+
     *                        stage_intern*stage_intern*(i-1))*pas
                         lpre=lcurrent
                         lcurrent=lpost
                      end do
                      lpre=lcurrent
                   end do
