                fac = 0.8d0*(1.0d0/err)**oneoverthree

                if (t < tfail) then
                   sec = 1
                else
                   sec = 0
                end if
                
                if((rej_counter < 2) .and. sec == 1) then
                   rej_counter = rej_counter + 1
                   fac = min(1.0d0,fac)
